DROP TABLE IF EXISTS `pub_file`;
CREATE TABLE `pub_file` (
  `file_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '流水号',
  `file_name` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `file_path` varchar(255) COLLATE utf8_bin NOT NULL,
  `file_cls` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '文件类别-业务分类',
  `rlat_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '关联业务id',
  `create_time` varchar(19) COLLATE utf8_bin NOT NULL COMMENT '创建时间(yyyy-MM-dd HH:mm:ss)',
  PRIMARY KEY (`file_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='文件表';

