DROP TABLE IF EXISTS `pub_notice`;
CREATE TABLE `pub_notice` (
  `notice_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '流水号',
  `title` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '标题',
  `content` mediumtext COLLATE utf8_bin COMMENT '消息内容',
  `app_id` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '公告应用ID',
  `front` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否置顶：1-置顶；0-不置顶',
  `notice_state` char(1) COLLATE utf8_bin NOT NULL COMMENT '公告状态：1-发布；0-停用；',
  `creator_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人ID',
  `create_time` varchar(19) COLLATE utf8_bin DEFAULT NULL COMMENT '创建时间(yyyy-MM-dd HH:mm:ss)',
  `editor_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '最后修改人',
  `edit_time` varchar(19) COLLATE utf8_bin DEFAULT NULL COMMENT '最后修改时间(yyyy-MM-dd HH:mm:ss)',
  PRIMARY KEY (`notice_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='公告表';

