-- ----------------------------
-- Table structure for pub_user
-- ----------------------------
DROP TABLE IF EXISTS `pub_user`;
CREATE TABLE `pub_user` (
  `user_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `user_name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '中文名称',
  `user_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '用户编号(例:职工号,昵称类似)',
  `login_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '登录名',
  `password` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '密码（MD5）',
  `cert_type` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '''证件类型：01-中国居民身份证，02-护照，03-港、澳居民往来内地通行证，04-台湾居民来往大陆通行证'',',
  `cert_no` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '证件号码',
  `phone_no` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '用户手机号',
  `e_mail` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '电子邮箱',
  `user_state` char(1) COLLATE utf8_bin NOT NULL COMMENT '状态:D-删除;U-禁用;E-可用',
  `note` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `creator_id` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人ID',
  `create_time` varchar(19) COLLATE utf8_bin DEFAULT NULL COMMENT '创建时间(yyyy-MM-dd HH:mm:ss)',
  `editor_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人ID',
  `edit_time` varchar(19) COLLATE utf8_bin DEFAULT NULL COMMENT '修改时间(yyyy-MM-dd HH:mm:ss)',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户表';

